import React from 'react';
import './App.css';

function callApi(){
  // Github fetch library : https://github.com/github/fetch
  // Call the API page
  fetch('https://www.reddit.com/r/reactjs.json')
  .then((result) => {
    // Get the result
    // If we want text, call result.text()
    return result.text();
  }).then((jsonResult) => {
    // Do something with the result
    console.log(jsonResult);
  })
}

function App() {
  return (
    <div className="App">
        <form>
          Pokemon: <input type="text" onChange={this.searchPokemon()}/>
        </form>
    </div>
  );
}

export default App;
